import React from "react";
import Overview from "../Overview/Overview";
import { motion } from "framer-motion";
function Home() {
  return (
    <motion.div
      initial={{ scale: 0 }}
      animate={{ y: 360, scale: 1 }}
      transition={{
        type: "spring",
        stiffness: 260,
        damping: 20,
      }}
    >
      <Overview />
    </motion.div>
  );
}

export default Home;
